import React from 'react';
import './tools.css';
import logo1 from './logo1.jpg'

function Tools() {
    return (
        <div className="toolcontainer">
             <div className="toolTitle">
                 <h4>Tools in Used</h4>
             <div className="toolImage">
                 <img src={logo1}/>
                 <img src={logo1}/>
                 <img src={logo1}/>
             </div>
             </div>
            

        </div>
      
           
       
            
              

          
            
      
    );
}

export default Tools;
